namespace MarcelJoachimKloubert\SimpleGallery;

\define('SG_INDEX', 1);

\define('SG_DIR_CURRENT', \realpath(__DIR__) . \DIRECTORY_SEPARATOR);

\define('SG_METHOD_INIT', 'init');
\define('SG_METHOD_ONERROR', 'onError');
\define('SG_METHOD_RUN', 'run');

/**
 * Gallery app.
 *
 * @author Marcel Joachim Kloubert <marcel.kloubert@gmx.net>
 *
 * @package MarcelJoachimKloubert\SimpleGallery
 */
class Gallery {
    /**
     * @var array
     */
    protected $_actions;
    /**
     * @var array
     */
    protected $_config;
    /**
     * @var string
     */
    protected $_defaultMimeType = 'application/octet-stream';
    /**
     * @var GalleryFileProvider
     */
    protected $_fileProvider;
    /**
     * @var array
     */
    protected $_iptcIndexes;
    /**
     * @var array
     */
    protected $_mime;
    /**
     * @var \DateTimeInterface
     */
    protected $_now;

    /**
     * Tries to return EXIF data from a file.
     *
     * @param string $path The path to the file.
     *
     * @return array The EXIF data.
     */
    protected function getEXIF($path) {
        $result = null;

        if (\function_exists("\\exif_read_data")) {
            $path = \realpath($path);
            if (\is_file($path)) {
                $result = @\exif_read_data($path);
            }
        }

        if (!\is_array($result)) {
            $result = [];
        }

        return $result;
    }

    /**
     * Returns the content of a file.
     *
     * @param string $file The name of the file to return.
     *
     * @return string|null|false The content or (null) if not found.
     *                           (false) indicates that an error occurred.
     */
    protected function getFile($ctx, $file) {
        try {
            return $this->_fileProvider
                        ->getFile($file, $ctx);
        }
        catch (\Exception $ex) {
            return false;
        }
    }

    /**
     * Returns the list of favorites.
     *
     * @param mixed $ctx The execution context.
     *
     * @return array The list of favorites.
     */
    protected function getFavorites($ctx) {
        $me = $this;

        if (!empty($_SESSION['SG_FAVORITES'])) {
            $favorites = $_SESSION['SG_FAVORITES'];
        }

        if (empty($favorites)) {
            $favorites = [];
        }

        if (!\is_array($favorites)) {
            $favorites = [];
        }

        // normalize
        $favorites = \array_map(function($x) {
            return \trim($x);
        }, $favorites);
        // cleanup
        $favorites = \array_filter($favorites, function($x) use ($ctx, $me) {
            return !empty($x) &&
            $me->isInScriptDirectory($ctx, $x);
        });
        $favorites = \array_unique($favorites);

        return $favorites;
    }

    /**
     * Tries to extract GPS coordinates from EXIF data.
     *
     * @param array $exifCoord The EXIF data.
     *
     * @return array|null The coordinates or (null) if not available.
     */
    protected function getGpsDataFromExifCoordinates($exifCoord) {
        if (!\is_array($exifCoord)) {
            return null;
        }

        $degrees = count($exifCoord) > 0 ? $this->gps2Num($exifCoord[0]) : 0;
        $minutes = count($exifCoord) > 1 ? $this->gps2Num($exifCoord[1]) : 0;
        $seconds = count($exifCoord) > 2 ? $this->gps2Num($exifCoord[2]) : 0;

        // normalize
        $minutes += ($degrees - floor($degrees)) * 60;
        $degrees  = floor($degrees);

        $seconds += ($minutes - floor($minutes)) * 60;
        $minutes  = floor($minutes);

        // extra normalization, probably not necessary unless you get weird data
        if ($seconds >= 60) {
            $minutes += floor($seconds / 60.0);
            $seconds -= 60 * floor($seconds / 60.0);
        }

        if ($minutes >= 60) {
            $degrees += floor($minutes / 60.0);
            $minutes -= 60 * floor($minutes / 60.0);
        }

        return ['degrees' => $degrees,
                'minutes' => $minutes,
                'seconds' => $seconds];
    }

    /**
     * Tries to return GPS data from EXIF.
     *
     * @param array $exif The EXIF data.
     *
     * @return array|null The GPS coordinates or (null) if NOT available.
     */
    protected function getGpsFromEXIF($exif) {
        if (\is_array($exif)) {
            // extract data
            $latData = null;
            $latRef = null;
            $lonData = null;
            $lonRef = null;
            foreach ($exif as $k => $v) {
                switch (\trim(\strtolower($k))) {
                    case 'gpslatitude':
                        $latData = $v;
                        break;

                    case 'gpslatituderef':
                        $latRef = \trim(\strtoupper($v));
                        break;

                    case 'gpslongitude':
                        $lonData = $v;
                        break;

                    case 'gpslongituderef':
                        $lonRef = \trim(\strtoupper($v));
                        break;
                }
            }

            $lat = $this->getGpsDataFromExifCoordinates($latData);
            if (\is_array($lat)) {
                $long = $this->getGpsDataFromExifCoordinates($lonData);
                if (\is_array($long)) {
                    $latDeg = ($lat['degrees'] + $lat['minutes'] / 60 + $lat['seconds'] / 3600);
                    $latDeg += ($latRef == 'W' or $latRef == 'S') ? -1 : 1;

                    $longDeg = ($long['degrees'] + $long['minutes'] / 60 + $long['seconds'] / 3600);
                    $longDeg += ($lonRef == 'W' or $lonRef == 'S') ? -1 : 1;

                    return ['lat'  => $latDeg,
                            'long' => $longDeg];
                }
            }
        }

        return null;
    }

    /**
     * Returns a list of image files and folders.
     *
     * @param GalleryExecutionContext $ctx The underlying execution context.
     *
     * @return array The list with files and folders.
     */
    protected function getImageFoldersAndFiles($ctx) {
        $filesAndFolders = [
            'dir' => $ctx->scopeDirectory,
            'files' => [],
            'folders' => [],
        ];
        
        $parentDir = null;
        if ('/' !== $filesAndFolders['dir'])
        {
            $parentDir = '/';
            $dirParts = \explode('/', $filesAndFolders['dir']);
            
            $dirPartCount = \count($dirParts);
            for ($i = 0; $i < $dirPartCount - 1; $i++) {
                $dp = $dirParts[$i];
                if ($i > 0) {
                    $parentDir .= '/';
                }
                
                $parentDir .= $dp;
            }
        }

        $filesAndFolders['parentDir'] = empty($parentDir) ? null : $parentDir;
        if (!empty($filesAndFolders['parentDir'])) {
            $filesAndFolders['folders'][] = [
                'name' => '..',
                'path' => $filesAndFolders['parentDir'],
                'search' => ['..'],
                'title' => '..',
            ];
        }
        
        if (\is_dir($ctx->directory)) {
            $dh = @\opendir($ctx->directory);
            if (\is_resource($dh)) {
                try {
                    $favorites = $this->getFavorites($ctx);
                    
                    while (false !== ($item = readdir($dh))) {
                        if ('.' === $item || '..' === $item) {
                            continue;
                        }

                        $fullPath = \realpath($ctx->directory . $item);
                        if (\is_file($fullPath) && $this->isImageFile($fullPath)) {
                            // file

                            $title = null;

                            $exif = $this->getEXIF($fullPath);
                            $gps = $this->getGpsFromEXIF($exif);

                            $iptc = $this->getIPTC($fullPath);
                            if (!empty($iptc['caption'])) {
                                $title = \trim($iptc['caption']);
                            }

                            if (empty($title)) {
                                $title = $item;
                            }
                            else {
                                $title .= ' (' . $item . ')';
                            }

                            $filesAndFolders['files'][] = [
                                'gps' => empty($gps) ? null : $gps,
                                'iptc' => empty($iptc) ? null : $iptc,
                                'isFav' => false !== \array_search($fullPath, $favorites),
                                'name' => $item,
                                'path' => '.' . $filesAndFolders['dir'] . (1 !== \strlen($filesAndFolders['dir']) ? '/' : '') . $item,
                                'search' => $this->getSearchExpressions($fullPath),
                                'title' => $title,
                            ];
                        }
                        else if ($ctx->allowFolders &&
                                 \is_dir($fullPath) && $this->isImageFolder($fullPath)) {
                            // folder

                            $filesAndFolders['folders'][] = [
                                'name' => $item,
                                'path' => $filesAndFolders['dir'] . (1 !== \strlen($filesAndFolders['dir']) ? '/' : '') . $item,
                                'search' => $this->getSearchExpressions($fullPath),
                                'title' => $item,
                            ];
                        }
                    }
                }
                finally {
                    \closedir($dh);
                }
            }
        }

        return $filesAndFolders;
    }

    /**
     * Tries to extract IPTC information from an (image) file.
     *
     * @param string $path The path of the file.
     *
     * @return array The data.
     */
    protected function getIPTC($path) {
        $path = \realpath($path);

        $result = [];

        if (\function_exists("\\getimagesize") && \function_exists("\\iptcparse")) {
            if (\is_file($path)) {
                $imgInfo = [];

                @\getimagesize($path, $imgInfo);
                if (\is_array($imgInfo) && \array_key_exists('APP13', $imgInfo)) {
                    $iptc = @\iptcparse($imgInfo['APP13']);
                    if (\is_array($iptc)) {
                        $result['caption']             = $this->getIPTCArrayDat($iptc, '2#120');
                        $result['category']            = $this->getIPTCArrayDat($iptc, '2#015');
                        $result['city']                = $this->getIPTCArrayDat($iptc, '2#090');
                        $result['country']             = $this->getIPTCArrayDat($iptc, '2#101');
                        $result['creation_date']       = $this->getIPTCArrayDat($iptc, '2#055');
                        $result['credit_byline_title'] = $this->getIPTCArrayDat($iptc, '2#085');
                        $result['graphic_name']        = $this->getIPTCArrayDat($iptc, '2#005');
                        $result['headline']            = $this->getIPTCArrayDat($iptc, '2#105');
                        $result['otr']                 = $this->getIPTCArrayDat($iptc, '2#103');
                        $result['photo_source']        = $this->getIPTCArrayDat($iptc, '2#115');
                        $result['photog']              = $this->getIPTCArrayDat($iptc, '2#080');
                        $result['source']              = $this->getIPTCArrayDat($iptc, '2#110');
                        $result['spec_instr']          = $this->getIPTCArrayDat($iptc, '2#040');
                        $result['state']               = $this->getIPTCArrayDat($iptc, '2#095');
                        $result['supp_categories']     = $this->getIPTCArrayDat($iptc, '2#020');
                        $result['urgency']             = $this->getIPTCArrayDat($iptc, '2#010');
                    }
                }
            }
        }

        return $result;
    }

    /**
     * Tries to return data from an IPTC array safe.
     *
     * @param array $iptc The IPTC array.
     * @param mixed $index The primary index.
     * @param mixed $subIndex The secondary index.
     * @param mixed $defaultVal The default value.
     *
     * @return mixed The value from $iptc or the default value if not found.
     */
    protected function getIPTCArrayDat($iptc, $index, $subIndex = 0, $defaultVal = null) {
        if (!\is_array($iptc)) {
            return $defaultVal;
        }

        if (!\array_key_exists($index, $iptc)) {
            return $defaultVal;
        }

        if (!\array_key_exists($subIndex, $iptc[$index])) {
            return $defaultVal;
        }

        return $iptc[$index][$subIndex];
    }

    /**
     * Returns a MIME type by a file name.
     * 
     * @param string $file The file name.
     * 
     * @return string|null The MIME type or (null) if $file is no valid name.
     */
    protected function getMimeTypeByFilename($file) {
        $pathInfo = @\pathinfo($file);
        if (\is_array($pathInfo)) {
            $ext = null;
            if (!empty($pathInfo['extension'])) {
                $ext = \trim(\strtolower($pathInfo['extension']));
            }

            if (!empty($this->_mime)) {
                foreach ($this->_mime as $mime => $validExtensions) {
                    $mime = \trim(\strtolower($mime));

                    // keep sure to have a list of extensions
                    if (!\is_array($validExtensions) && !($validExtensions instanceof \Traversable)) {
                        $validExtensions = [ $validExtensions ];
                    }

                    foreach ($validExtensions as $ve) {
                        if (\trim(\strtolower($ve)) === $ext) {
                            return $mime;  // found
                        }
                    }
                }
            }

            return $this->_defaultMimeType;
        }

        return null;
    }

    /**
     * Returns the output encoding.
     * 
     * @return string The encoding.
     */
    protected function getOutputEncoding() {
        return 'utf-8';
    }

    /**
     * Returns the script directory.
     *
     * @param mixed $ctx The execution context.
     *
     * @return string The full path of the directory.
     */
    protected function getScriptDirectory($ctx) {
        $directory = \realpath(@\getcwd());
        if (!\is_dir($directory)) {
            $directory = \realpath(SG_DIR_CURRENT);
        }

        return $directory;
    }

    /**
     * Tries to return a list of search expressions for a file or a folder.
     *
     * @param string $path The path of the file/folder.
     *
     * @return array The list of search expressions.
     */
    protected function getSearchExpressions($path) {
        $path = \realpath($path);

        $expr = [];

        if (\is_file($path)) {
            $pathInfo = @\pathinfo($path);
            if (\is_array($pathInfo)) {
                if (!empty($pathInfo['basename'])) {
                    $expr[] = (string)$pathInfo['basename'];
                }
            }

            // EXIF
            $exif = $this->getEXIF($path);
            foreach ($exif as $k => $v) {
                switch (\trim(\strtolower($k))) {
                    case 'filename':
                        $expr[] = $v;
                        break;
                }
            }

            // IPTC
            $iptc = $this->getIPTC($path);
            foreach ($this->_iptcIndexes as $i) {
                if (empty($iptc[$i])) {
                    continue;
                }

                $expr[] = $iptc[$i];
            }
        }
        else if (\is_dir($path)) {
            $pathInfo = @\pathinfo($path);
            if (\is_array($pathInfo)) {
                if (!empty($pathInfo['basename'])) {
                    $expr[] = (string)$pathInfo['basename'];
                }
            }
        }

        // normalize
        $expr = \array_map(function($x) {
            return \trim(\strtolower($x));
        }, $expr);

        // remove empty
        $expr = \array_filter($expr, function($x) {
            return '' !== $x;
        });

        // remove duplicates
        $expr = \array_unique($expr);

        return $expr;
    }

    /**
     * Helper for converting a GPS string to a number.
     *
     * @param string $coordPart The coordinate string.
     *
     * @return float The string as number.
     */
    protected function gps2Num($coordPart) {
        $parts = \explode('/', $coordPart);

        if (\count($parts) < 1) {
            return 0.0;
        }

        if (1 === \count($parts)) {
            return (float)$parts[0];
        }

        return (float)$parts[0] / (float)$parts[1];
    }

    /**
     * Initializes the gallery app.
     *
     * @param array $config The configuration for the application.
     *
     * @return null|false|int If (false) the script will throw an generic exception.
     *                        If not (null) the result will be handled as exit code (integer value).
     *
     * @throws \Exception Something went wrong.
     */
    public function init($config) {
        $this->_now = new \DateTime();
        
        $me = $this;

        $this->_config = $config;

        // valid IPTC indexes
        $this->_iptcIndexes = [
            'caption',
            'city',
            'country',
            'creation_date',
            'credit_byline_title',
            'graphic_name',
            'headline',
            'photo_source',
            'photog',
            'source',
            'state'];  //TODO: read from config, if available

        // actions
        $this->_actions = [
            '' => function($ctx) use ($me) {
                return $me->showPage($ctx);
            },
            'font' => function($ctx) use ($me) {
                return $me->outputFontFile($ctx);
            },
            'get_image_files_and_folders' => function($ctx) use ($me) {
                return $me->outputFoldersAndFiles($ctx);
            },
            'image' => function($ctx) use ($me) {
                return $me->outputImageFile($ctx);
            },
            'toggle_favorite' => function($ctx) use ($me) {
                return $me->toggleFavorite($ctx);
            }
        ];  //TODO: read from config, if available

        // MIME types with valid file extensions
        $this->_mime = [
            // fonts
            'application/vnd.ms-fontobject' => 'eot',
            'application/x-font-opentype' => 'otf',
            'application/x-font-ttf' => 'ttf',
            'application/font-woff' => 'woff',
            'application/font-woff2' => 'woff2',

            // images
            'image/gif' => 'gif',
            'image/jpeg' => ['jpg', 'jpeg'],
            'image/png' => 'png',
            'image/svg+xml' => 'svg',
        ];  //TODO: read from config, if available

        // file provider
        if (!empty($this->_config['fileProvider'])) {
            if (!empty($this->_config['fileProvider']['class'])) {
                $fileProviderClassName = \trim($this->_config['fileProvider']['class']);
            }
        }
        if (empty($fileProviderClassName)) {
            $fileProviderClassName = GalleryFileProvider::class;
        }
        $this->_fileProvider = new $fileProviderClassName();
    }

    /**
     * Checks if a directory is a valid image folder.
     *
     * @param string $path The path of the directory.
     *
     * @return bool Is valid folder or not.
     */
    protected function isImageFolder($path) {
        $path = \realpath($path);
        if (\is_dir($path)) {
            $pathInfo = \pathinfo($path);
            if (\is_array($pathInfo)) {
                if (!empty($pathInfo['basename'])) {
                    if ('.' !== \substr(\trim($pathInfo['basename']), 0, 1)) {
                        // check if at least one image file
                        // is stored in the folder
                        $dh = \opendir($path);
                        if (@\is_resource($dh)) {
                            try {
                                while (false !== ($item = \readdir($dh))) {
                                    if ('.' === $item || '..' === $item) {
                                        continue;
                                    }

                                    $fullPath = \realpath($path . \DIRECTORY_SEPARATOR . $item);
                                    if (\is_file($fullPath)) {
                                        if ($this->isImageFile($fullPath)) {
                                            return true;  // yes
                                        }
                                    }
                                }
                            }
                            finally {
                                \closedir($dh);
                            }    
                        }                        
                    }
                }
            }
        }

        return false;
    }

    /**
     * Checks if a file is an image or not.
     * 
     * @param string $path The file to check.
     * 
     * @return bool Is image or not.
     */
    protected function isImageFile($path) {
        $path = \realpath($path);
        if (\is_file($path)) {
            return 0 === \stripos(\trim($this->getMimeTypeByFilename($path)),
                                  'image/');
        }

        return false;
    }

    /**
     * Checks if a path is inside the script directory or not.
     *
     * @param mixed $ctx The execution context.
     * @param string $path The path to check.
     *
     * @return bool Is in script directory or not.
     */
    protected function isInScriptDirectory($ctx, $path) {
        $path = \realpath($path);
        if (false !== $path) {
            $directory = $this->getScriptDirectory($ctx);

            return 0 === \strpos($path, $directory . \DIRECTORY_SEPARATOR);
        }

        return false;
    }

