<?= $this->getFile($ctx, 'font-awesome.min.css') ?>

</style>

        <?php
    }

    /**
     * Outputs a font file.
     *
     * @param GalleryExecutionContext $ctx The execution context.
     */
    protected function outputFontFile($ctx) {
        $fontFile = null;
        if (!empty($_REQUEST['f'])) {
            $fontFile = (string)$_REQUEST['f'];
        }

        $fontFile = \trim(\strtolower($fontFile));
        if (!empty($fontFile)) {
            $font = $this->getFile($ctx, $fontFile);
        }

        if (!empty($font)) {
            $contentType = $this->getMimeTypeByFilename($fontFile);

            \header('Content-type: ' . $contentType);
            echo $font;
        }
        else {
            \header(':', true, 404);
        }
    }

    /**
     * Outputs the page FOOTER.
     *
     * @param GalleryExecutionContext $ctx The execution context.
     */
    protected function outputFooter($ctx) {
        $jsFile = '';
        $styleFile = '';
        if (!empty($this->_config['files'])) {
            if (!empty($this->_config['files']['script'])) {
                $jsFile = \trim($this->_config['files']['script']);
            }

            if (!empty($this->_config['files']['style'])) {
                $styleFile = \trim($this->_config['files']['style']);
            }
        }

        // check for defaults
